    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments for the 1984 calendar year.
    The report begins by giving Refuge highlights and describing the climate and habitat
    conditions in the Refuge, as well as personnel, youth programs, funding, safety,
    and technical assistance. The habitat management section discusses forests, grasslands,
    grazing, haying, fire management, pest control, and wilderness and special areas.
    Wildlife- including endangered and threatened species, migratory birds, upland game
    birds, big game animals, surplus animal disposal, animal control, marking and banding,
    and disease prevention and control- are discussed. The public relations section
    discusses information and interpretation, recreational uses, law enforcement, and
    cooperative associations. The construction and maintenance section describes rehabilitation,
     maintenance, equipment utilization and replacement, and communication systems.
    Cooperative programs and items of interest are discussed. Photographs and brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
